import React, { Component } from 'react';
import './App.css';
import { Button, ButtonGroup, Container } from 'reactstrap';
import { Link } from 'react-router-dom';

class Home extends Component {
    render() {
        return (
            <div class="jumbotron">
                <Container fluid>
                <h1 class = "pos_center">Welcome to Management System!</h1>
                <h4 class="pos_center"> Manage your employees and action items in all-in-one platform!</h4>

                <button class="button_example" size="lg" color="primary" tag={Link} to={"/Users"}>Users</button>
                <button class="button_example" size="lg" color="warning" tag={Link} to={"/Tasks"}>Tasks</button>


                </Container>
            </div>
        );
    }
}

export default Home
